from typing import List

def pluck(arr: List[int]) -> List[int]:
    smallest_even = None
    smallest_index = -1
    for i, num in enumerate(arr):
        if num % 2 == 0:
            if smallest_even is None or num < smallest_even:
                smallest_even = num
                smallest_index = i
    return [smallest_even, smallest_index] if smallest_even is not None else []

