from typing import List, Optional

def prod_signs(arr: List[int]) -> Optional[int]:
    if not arr:
        return None
    sign_product = 1
    magnitude_sum = 0
    for num in arr:
        if num > 0:
            sign_product *= 1
        elif num < 0:
            sign_product *= -1
        else:
            sign_product *= 0
        magnitude_sum += abs(num)
    return sign_product * magnitude_sum

