    def convert_to_float(value: Union[int, float, str]) -> float:
        if isinstance(value, str):
            value = value.replace(',', '.')
        return float(value)
    a_float = convert_to_float(a)
    b_float = convert_to_float(b)
    if a_float == b_float:
        return None
    elif a_float > b_float:
        return a
    else:
        return b

