def fix_spaces(text: str) -> str:
    result = []
    i = 0
    n = len(text)
    while i < n:
        if text[i] == ' ':
            count = 1
            while i + count < n and text[i + count] == ' ':
                count += 1
            if count > 2:
                result.append('-')
            else:
                result.append('_' * count)
            i += count
        else:
            result.append(text[i])
            i += 1
    return ''.join(result)

