def poohbear(s: str) -> str:
    cells = {}
    ptr = 0
    cells[ptr] = 0
    copied_value = 0
    output = []
    i = 0
    n = len(s)
    loop_stack = []
    while i < n:
        cmd = s[i]
        if cmd == '+':
            cells[ptr] = (cells.get(ptr, 0) + 1) % 256
        elif cmd == '-':
            cells[ptr] = (cells.get(ptr, 0) - 1) % 256
        elif cmd == '>':
            ptr += 1
            if ptr not in cells:
                cells[ptr] = 0
        elif cmd == '<':
            ptr -= 1
            if ptr not in cells:
                cells[ptr] = 0
        elif cmd == 'c':
            copied_value = cells.get(ptr, 0)
        elif cmd == 'p':
            cells[ptr] = copied_value
        elif cmd == 'W':
            if cells.get(ptr, 0) == 0:
                loop_depth = 1
                while loop_depth > 0:
                    i += 1
                    if i >= n:
                        break
                    if s[i] == 'W':
                        loop_depth += 1
                    elif s[i] == 'E':
                        loop_depth -= 1
            else:
                loop_stack.append(i)
        elif cmd == 'E':
            if cells.get(ptr, 0) != 0:
                i = loop_stack[-1] - 1
            else:
                loop_stack.pop()
        elif cmd == 'P':
            output.append(chr(cells.get(ptr, 0)))
        elif cmd == 'N':
            output.append(str(cells.get(ptr, 0)))
        elif cmd == 'T':
            cells[ptr] = cells.get(ptr, 0) * 2 % 256
        elif cmd == 'Q':
            cells[ptr] = cells.get(ptr, 0) ** 2 % 256
        elif cmd == 'U':
            cells[ptr] = int(math.sqrt(cells.get(ptr, 0))) % 256
        elif cmd == 'L':
            cells[ptr] = (cells.get(ptr, 0) + 2) % 256
        elif cmd == 'I':
            cells[ptr] = (cells.get(ptr, 0) - 2) % 256
        elif cmd == 'V':
            cells[ptr] = cells.get(ptr, 0) // 2 % 256
        elif cmd == 'A':
            cells[ptr] = (cells.get(ptr, 0) + copied_value) % 256
        elif cmd == 'B':
            cells[ptr] = (cells.get(ptr, 0) - copied_value) % 256
        elif cmd == 'Y':
            cells[ptr] = cells.get(ptr, 0) * copied_value % 256
        elif cmd == 'D':
            if copied_value != 0:
                cells[ptr] = cells.get(ptr, 0) // copied_value % 256
        i += 1
    return ''.join(output)

