def solve(a: List[int]) -> List[int]:
    a_set = set(a)
    result = []

    def backtrack(current):
        if len(result) == len(a):
            return True
        if current * 2 in a_set and current * 2 not in result:
            result.append(current * 2)
            if backtrack(current * 2):
                return True
            result.pop()
        if current % 3 == 0 and current // 3 in a_set and (current // 3 not in result):
            result.append(current // 3)
            if backtrack(current // 3):
                return True
            result.pop()
        return False
    for num in a:
        result = [num]
        if backtrack(num):
            return result
    return []

