def solve(a: List[int]) -> List[int]:
    count = defaultdict(int)
    for num in a:
        count[num] += 1

    def dfs(x):
        if count[x] == 0:
            return []
        result = [x]
        count[x] -= 1
        if x % 3 == 0 and x // 3 in count and (count[x // 3] > 0):
            result.extend(dfs(x // 3))
        if x * 2 in count and count[x * 2] > 0:
            result.extend(dfs(x * 2))
        return result
    for num in sorted(a, reverse=True):
        sequence = dfs(num)
        if len(sequence) == len(a):
            return sequence
    return []

