    for num in a:
        count[num] += 1

    def backtrack(current, count, result):
        if len(result) == len(a):
            return result
        if current % 3 == 0 and current // 3 in count and (count[current // 3] > 0):
            count[current // 3] -= 1
            result.append(current // 3)
            res = backtrack(current // 3, count, result)
            if res:
                return res
            result.pop()
            count[current // 3] += 1
        if current * 2 in count and count[current * 2] > 0:
            count[current * 2] -= 1
            result.append(current * 2)
            res = backtrack(current * 2, count, result)
            if res:
                return res
            result.pop()
            count[current * 2] += 1
        return None
    for num in a:
        temp_count = count.copy()
        temp_count[num] -= 1
        res = backtrack(num, temp_count, [num])
        if res:
            return res
    return []

