    a.pop(0)
    while a:
        last = result[-1]
        next_val = None
        for num in a:
            if last * 2 == num or (last % 3 == 0 and last // 3 == num):
                next_val = num
                break
        if next_val is None:
            last = result[0]
            for num in a:
                if num * 2 == last or (num % 3 == 0 and num // 3 == last):
                    next_val = num
                    break
            result.appendleft(next_val)
        else:
            result.append(next_val)
        a.remove(next_val)
    return list(result)

