def chess_bishop_dream(b: List[int], p: List[int], d: List[int], k: int) -> List[int]:
    rows, cols = (b[0], b[1])
    x, y = (p[0], p[1])
    dx, dy = (d[0], d[1])

    def next_pos(x, y, dx, dy):
        x += dx
        y += dy
        if x < 0 or x >= rows:
            dx *= -1
            x += 2 * dx
        if y < 0 or y >= cols:
            dy *= -1
            y += 2 * dy
        return (x, y, dx, dy)

    def find_cycle(x, y, dx, dy):
        visited = {}
        steps = 0
        while (x, y, dx, dy) not in visited:
            visited[x, y, dx, dy] = steps
            x, y, dx, dy = next_pos(x, y, dx, dy)
            steps += 1
        cycle_start = visited[x, y, dx, dy]
        cycle_length = steps - cycle_start
        return (cycle_start, cycle_length)
    cycle_start, cycle_length = find_cycle(x, y, dx, dy)
    if k < cycle_start:
        for _ in range(k):
            x, y, dx, dy = next_pos(x, y, dx, dy)
        return [x, y]
    else:
        remaining_steps = (k - cycle_start) % cycle_length
        for _ in range(cycle_start + remaining_steps):
            x, y, dx, dy = next_pos(x, y, dx, dy)
        return [x, y]

